import React from 'react';
import { connect } from 'react-redux';
import AlbumListing from '../src/ compoents/AlbumListing'
import getAlbums from './state/selectors/getAlbums';
import withCollapse from '../src/ compoents/withCollapse';
import { useSelector, useDispatch } from "react-redux";

// Use container pattern to decouple conerns from grid
const AlbumListingContainer = connect(getAlbums)(AlbumListing);

// Use Higher order component to reduce duplicate of collapse
const AlbumListingWithCollapse = withCollapse('Albums', AlbumListingContainer);

function App() {

  const albumns = useSelector(state => state.albumns)
  console.log('1', albumns);

  return (
    <AlbumListingWithCollapse></AlbumListingWithCollapse>
  );
}

export default App;
